open Tester
module T = Testtools
module Ex = Exercise.Main


let const n = Ex.Const n
let add (a, b) = Ex.Add (a, b)
let mul (a, b) = Ex.Mul (a, b)

let rec string_of_arith = function
  | Ex.Const n -> string_of_int n
  | Ex.Add (p, q) -> "(" ^ string_of_arith p ^ "+" ^ string_of_arith q ^ ")"
  | Ex.Mul (p, q) -> "(" ^ string_of_arith p ^ "*" ^ string_of_arith q ^ ")"
  
let rec list_of_mul = function
      Ex.Const n -> [n]
    | Ex.Mul (a, b) -> (list_of_mul a) @ (list_of_mul b)
    | Ex.Add (a, b) -> assert false

let rec list_of_add = function
    Ex.Const n -> [[n]]
  | Ex.Add (a, b) -> (list_of_add a) @ (list_of_add b)
  | m -> [list_of_mul m]

let normalize a =
  let rec f s = function
      h::t -> f ((List.sort compare h) :: s) t
    | _ -> s in
  let l = f [] a in
  List.sort compare l

let eq_expanded a b =
  normalize a = normalize b

let rec string_of_expanded l =
  let rec f = function
      [h] -> string_of_int h
    | h::t -> string_of_int h ^ "*" ^ f t
    | _ -> "" in
  match l with
      [h] -> f h
    | h::t -> f h ^ "+" ^ string_of_expanded t
    | _ -> ""

